"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[5025],{91725:(e,t,i)=>{i.r(t),i.d(t,{default:()=>o,johnChapter16PL:()=>a});const a={chapter:16,title:"Jean 16",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"To wam m\xf3wi\u0142em, aby\u015bcie si\u0119 nie zgorszyli.",strong:[]},{number:2,text:"Z b\xf3\u017cnic was wy\u0142\u0105cz\u0105; owszem idzie godzina, i\u017c ka\u017cdy, kt\xf3ry was zabije, b\u0119dzie si\u0119 rozumia\u0142, \u017ce Bogu pos\u0142ug\u0119 czyni.",strong:[{text:"rendre",strong:"G1743",start:94,end:100},{text:"Dieu",strong:"G2316",start:112,end:116}]},{number:3,text:"A to wam czyni\u0107 b\u0119d\u0105, i\u017c nie poznali Ojca, ani mnie.",strong:[]},{number:4,text:"Ale tom wam powiedzia\u0142, aby\u015bcie, gdy przyjdzie godzina, pami\u0119tali na to, \u017cem wam ja to powiedzia\u0142; a tego\u017c wam na pocz\u0105tku nie powiedzia\u0142em, i\u017cem z wami by\u0142.",strong:[{text:"commencement",strong:"G746",start:145,end:157},{text:"avec",strong:"G1848",start:177,end:181}]},{number:5,text:"A teraz id\u0119 do tego, kt\xf3ry mi\u0119 pos\u0142a\u0142, a \u017caden z was nie pyta mi\u0119: Dok\u0105d idziesz?",strong:[{text:"aucun",strong:"G3762",start:54,end:59}]},{number:6,text:"Ale \u017ce wam to powiedzia\u0142em, smutek nape\u0142ni\u0142 serce wasze.",strong:[]},{number:7,text:"Wszak\u017ce ja wam prawd\u0119 powiadam: Po\u017cyteczno wam jest, abym ja odszed\u0142; bo je\u017alibym ja nie odszed\u0142, Pocieszyciel nie przyszed\u0142by do was; ale je\u017ali odejd\u0119, po\u015bl\u0119 go do was.",strong:[]},{number:8,text:"A gdy on przyjdzie, b\u0119dzie \u015bwiat kara\u0142 o grzech, i o sprawiedliwo\u015b\u0107, i o s\u0105d:",strong:[{text:"monde",strong:"G2889",start:40,end:45},{text:"justice",strong:"G2920",start:78,end:85},{text:"jugement",strong:"G2920",start:93,end:101}]},{number:9,text:"O grzech, i\u017c nie uwierzyli we mnie;",strong:[]},{number:10,text:"A o sprawiedliwo\u015b\u0107, \u017ce id\u0119 do Ojca mego, a ju\u017c mi\u0119 wi\u0119cej nie ujrzycie;",strong:[{text:"justice",strong:"G2920",start:3,end:10}]},{number:11,text:"A o s\u0105d, \u017ce ksi\u0105\u017c\u0119 tego \u015bwiata jest os\u0105dzony.",strong:[{text:"jugement",strong:"G2920",start:3,end:11},{text:"monde",strong:"G2889",start:39,end:44}]},{number:12,text:"Jeszcze wiele mam do was m\xf3wi\u0107, ale teraz znie\u015b\u0107 nie mo\u017cecie.",strong:[{text:"beaucoup",strong:"G4183",start:12,end:20},{text:"dire",strong:"H559",start:38,end:42}]},{number:13,text:"Ale gdy on przyjdzie, Duch prawdy, b\u0119dzie was wi\xf3d\u0142 do wszelakiej prawdy; bo nie b\u0119dzie m\xf3wi\u0142 sam od siebie, ale cokolwiek us\u0142yszy, to m\xf3wi\u0107 b\u0119dzie, i przysz\u0142e rzeczy wam opowie.",strong:[{text:"Esprit",strong:"G4151",start:34,end:40},{text:"dans",strong:"H6887",start:69,end:73},{text:"tout",strong:"G3956",start:139,end:143}]},{number:14,text:"On mi\u0119 uwielbi; bo z mego we\u017amie, a opowie wam.",strong:[]},{number:15,text:"Wszystko, co ma Ojciec, moje jest; przeto\u017cem powiedzia\u0142, \u017ce z mego we\u017amie, a opowie wam.",strong:[{text:"Tout",strong:"G3956",start:0,end:4}]},{number:16,text:"Maluczko, a nie ujrzycie mi\u0119; a zasi\u0119 maluczko, a ujrzycie mi\u0119; bo ja id\u0119 do Ojca.",strong:[]},{number:17,text:"Tedy rzekli niekt\xf3rzy z uczni\xf3w jego mi\u0119dzy sob\u0105: C\xf3\u017c to jest, co nam m\xf3wi: Maluczko, a nie ujrzycie mi\u0119; a zasi\u0119 maluczko, a ujrzycie mi\u0119, i \u017ce ja id\u0119 do Ojca?",strong:[]},{number:18,text:"Przeto\u017c m\xf3wili: C\xf3\u017c to jest, co m\xf3wi: Maluczko? nie wiemy, co m\xf3wi.",strong:[]},{number:19,text:"A Jezus pozna\u0142, \u017ce go chcieli pyta\u0107, i rzek\u0142 im: O tem pytacie si\u0119 mi\u0119dzy sob\u0105, \u017cem powiedzia\u0142: Maluczko, a nie ujrzycie mi\u0119; a zasi\u0119 maluczko, a ujrzycie mi\u0119?",strong:[{text:"interroger",strong:"G2065",start:33,end:43}]},{number:20,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: \u017be p\u0142aka\u0107 i lamentowa\u0107 b\u0119dziecie wy, ale \u015bwiat si\u0119 b\u0119dzie weseli\u0142; a wy smuci\u0107 si\u0119 b\u0119dziecie, ale smutek wasz obr\xf3ci si\u0119 w rado\u015b\u0107.",strong:[{text:"monde",strong:"G2889",start:84,end:89},{text:"dans",strong:"H6887",start:114,end:118}]},{number:21,text:"Niewiasta gdy rodzi, smutek ma, i\u017c przysz\u0142a godzina jej; ale gdy porodzi dzieci\u0119, ju\u017c wi\u0119cej nie pami\u0119ta na ucisk, dla rado\u015bci, \u017ce si\u0119 cz\u0142owiek na \u015bwiat narodzi\u0142.",strong:[{text:"jour",strong:"H3117",start:116,end:120},{text:"enfant",strong:"G5040",start:125,end:131},{text:"homme",strong:"G444",start:217,end:222},{text:"dans",strong:"H6887",start:230,end:234},{text:"monde",strong:"G2889",start:238,end:243}]},{number:22,text:"I wy tedy teraz smutek macie; ale was zasi\u0119 ujrz\u0119, i rozraduje si\u0119 serce wasze, a rado\u015bci waszej nikt od was nie odejmie.",strong:[{text:"dans",strong:"H6887",start:38,end:42}]},{number:23,text:"A w on dzie\u0144 nie b\u0119dziecie si\u0119 mnie pyta\u0107 o nic. Zaprawd\u0119, zaprawd\u0119 powiadam wam: \u017be o cokolwiek by\u015bcie prosili Ojca w imieniu mojem, da wam.",strong:[{text:"jour",strong:"H3117",start:6,end:10},{text:"rien",strong:"G3762",start:47,end:51}]},{number:24,text:"A\u017c dot\u0105d nie prosili\u015bcie o nic w imieniu mojem; pro\u015bcie, a we\u017amiecie, aby rado\u015b\u0107 wasza by\u0142a zupe\u0142na.",strong:[{text:"rien",strong:"G3762",start:28,end:32}]},{number:25,text:"To wam w przypowie\u015bciach m\xf3wi\u0142em; ale idzie godzina, gdy ju\u017c nie b\u0119d\u0119 wam w przypowie\u015bciach m\xf3wi\u0142, ale jawnie o Ojcu opowiem wam.",strong:[]},{number:26,text:"W on dzie\u0144 w imieniu mojem prosi\u0107 b\u0119dziecie, a nie powiadam wam, \u017ce ja b\u0119d\u0119 prosi\u0142 Ojca za wami;",strong:[{text:"jour",strong:"H3117",start:6,end:10}]},{number:27,text:"Albowiem sam Ojciec mi\u0142uje was, i\u017ce\u015bcie wy mi\u0119 umi\u0142owali, i uwierzyli\u015bcie, \u017cem ja od Boga wyszed\u0142.",strong:[{text:"Dieu",strong:"G2316",start:102,end:106}]},{number:28,text:"Wyszed\u0142em od Ojca, i przyszed\u0142em na \u015bwiat; zasi\u0119 opuszczam \u015bwiat, a id\u0119 do Ojca.",strong:[{text:"dans",strong:"H6887",start:39,end:43},{text:"monde",strong:"G2889",start:47,end:52},{text:"monde",strong:"G2889",start:78,end:83}]},{number:29,text:"Rzekli mu uczniowie jego: Oto teraz jawnie m\xf3wisz, a \u017cadnej przypowie\u015bci nie powiadasz.",strong:[]},{number:30,text:"Teraz wiemy, \u017ce wiesz wszystko, a nie potrzebujesz, aby ci\u0119 kto pyta\u0142; w tem wierzymy, \u017ce\u015b od Boga wyszed\u0142.",strong:[{text:"besoin",strong:"H2637",start:69,end:75},{text:"personne",strong:"G3762",start:80,end:88},{text:"Dieu",strong:"G2316",start:149,end:153}]},{number:31,text:"Odpowiedzia\u0142 im Jezus: Teraz wierzycie?",strong:[]},{number:32,text:"Oto idzie godzina, a ju\u017c przysz\u0142a, i\u017c si\u0119 rozprosz\u0105 ka\u017cdy na swoj\u0119 stron\u0119, a mi\u0119 samego zostawicie; ale nie jestem sam, bo Ojciec ze mn\u0105 jest.",strong:[{text:"seul",strong:"G3439",start:114,end:118},{text:"seul",strong:"G3439",start:140,end:144},{text:"avec",strong:"G1848",start:162,end:166}]},{number:33,text:"To wam m\xf3wi\u0142em, aby\u015bcie we mnie pok\xf3j mieli; na \u015bwiecie ucisk mie\u0107 b\u0119dziecie, ale ufajcie, jam zwyci\u0119\u017cy\u0142 \u015bwiat.",strong:[{text:"paix",strong:"G1515",start:49,end:53},{text:"dans",strong:"H6887",start:90,end:94},{text:"monde",strong:"G2889",start:98,end:103},{text:"monde",strong:"G2889",start:141,end:146}]}]},o=a}}]);
